import React, { useState, useEffect } from 'react';

function convert(date){
    const newDate = new Date(date);
    const updatedDate = newDate.getDate();
    const updatedMonth = newDate.getMonth();
    const updatedYear = newDate.getFullYear();
    const updatedHours = newDate.getHours();
    const updatedMinutes = newDate.get
    return updatedDate;
}
const WazuhActive = () => {
  const [activeCount, setActiveCount] = useState({
    data: {
      total_count: 0,
      affected_items: [{ os_name: "", agent_name: "", registerIP: "", dateAdd: "" }]
    }
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch("http://localhost:3001/get-active_count");
      const activeCountData = await response.json();
      console.log(activeCountData);
      setActiveCount(activeCountData);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h4 className="px-3">&gt;&nbsp;Active Users: {activeCount.data.total_count}</h4>

      <table className='m-5'>
        <thead>
          <tr>
            <th>OS</th>
            <th>Agent Name</th>
            <th>IP</th>
            <th className='ps-5'>Date</th>
          </tr>
        </thead>
        <tbody>
          {activeCount.data.affected_items.map((item, index) => (
            <tr key={index}>
              <td>{item.os_name}</td>
              <td>{item.agent_name}</td>
              <td>{item.registerIP}</td>
              <td className='ps-5'>{convert(item.dateAdd)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default WazuhActive;
